import React from "react";
import * as ReactDOM from "react-dom";
import Header from "./Components/Header";
import Mainpage from "./Components/Mainpage";

const App = () => {
  return (
    <>
      <Header />
      <Routes>
        <Route path="/" element={<Mainpage />} />
      </Routes>
    </>
  );
};
export default App;
